import './App.css';
import Myheader from "./components/first_sec";
import Slider from "./components/slider";
import Footer from "./components/footer"; 
import Products from "./components/product";
import Maincard from './components/card';


function App() {
  return (
    <div>
      <Myheader menu="Home" />



      <Slider></Slider>
      <Products></Products>
      <Maincard></Maincard>
      <Footer></Footer>


    </div>
  );
}



export default App;
